# -*- coding: utf-8 -*-

#	NOTES:
#	This is a true seven card evaluator. That means the evaluator needs 
#	to run just once to evaluate a hand. Most people's idea of a 7 card 
#	evaluator is create a 5 card evaluator and run it 21 times just to 
#	score one hand. Not the brightest idea.
#	
#	Using primes to represent card ranks was based on an idea by Cactus Kev.
#	The rest is my own original work. It is a port to Python of my PHP version 
#	used here: http://bokehman.satellites-xml.org/poker_calculator/
#	
#	Look-up tables updated 2007-09-08 due to a handful of errors with ace 
#	low straights.
#	
#	Look up tables are global so they are created when the script is first 
#	accessed rather than being created and discarded every time the function 
#	runs (which would be pretty inefficient).
#
#	Hands that are theoretically impossible in 7 card evaluation such as 
#	7 high (7, 5, 4, 3, 2) have been omited from the look up table but
#	their scores taken into acount so scores from this evaluator remain
#	in sync with similar 5 card evaluators.
#		
#	The flush search may seem a little strange at first but was done this way 
#	to avoid sorting of any kind (look-up tables were used instead).
#	
#	49205, non-flushes
#	1287, 5-card flushes
#	1716, 6-card flushes
#	1716, 7-card flushes
#
#	DESCRIPTION:
#	int ScoreHand( list hand )
#		
#	INPUT:
#	A list of 7 items, each item representing one card in the following format: 
#	2 characters, the first character represents the card rank, (AKQJT98765432) 
#	and the second character represents the suit (CDHS). Alphabetical characters 
#	are required to be upper case. Example input list:
#	['AH', '5H', '4H', '9C', 'TC', '2D', '3H')]
#		
#	RETURN VALUE:
#	An integer between between 1 (Royal Flush) and 7414 (Nine High). 
#	The lower the value the better the hand. That simple!
#		
#	EXAMPLE USE:
#	hand = ['AH', '5H', '4H', '9C', 'TC', '2H', '3H']
#	print ScoreHand(hand)
	
