def ScoreHand(hand):
	# Get the numeric rank value of the seven card hand (Cactus Kev prime number method) and  
	# look up its integer value in the "NormalHands" look-up table. (Goes out of bounds of a 
	# 32 bit signed integer. Python will use a long here if necessary.)
	NormalHand = NormalHands[RankValues[hand[0][0]]*RankValues[hand[1][0]]*RankValues[hand[2][0]]*RankValues[hand[3][0]]*RankValues[hand[4][0]]*RankValues[hand[5][0]]*RankValues[hand[6][0]]]
	
	# Concatenate the the suits of the seven input cards to make a pattern. For example: "CHDSCCD", etc. 
	SuitOrder = "%s%s%s%s%s%s%s" % (hand[0][1], hand[1][1], hand[2][1], hand[3][1], hand[4][1], hand[5][1], hand[6][1])
	
	# FlushPositions[FlushPattern[SuitOrder]] gets a list containing the positions of the 
	# flush cards within the "hand" list variable. Now we can just run through those cards
	# to get a Cactus Kev value for the flush cards. A loop is used because it is not clear
	# how many suited cards there might be (5, 6 or 7) 
	if SuitOrder in FlushPattern: # Check if that pattern exists in the FlushPattern look-up table
		SuitValue = 1 # initialize this variable for multiplication below.
		for index in FlushPositions[FlushPattern[SuitOrder]]:
			SuitValue *= RankValues[hand[index][0]]

		# Look-up the flush hand in the "FlushHands" look-up table. If the flush has a lower
		# value than the "NormalHand" return the integer value of the flush hand. (Note: A 
		# straight flush will have a lower integer value than a full house or quad hand but
		# a standard flush will not. Again this means no sorting; just return the lower value
		# of the two.)
		FlushHand = FlushHands[SuitValue]
		if FlushHand < NormalHand:
			return FlushHand

	# If we got this far there was either no "FlushHand", or the value of any "FlushHand" was not 
	# as low as the "NormalHand". Either way we just return the integer value of the "NormalHand".  
	return NormalHand
